import {
    LOGIN_REQUEST,
    LOGIN_REQUEST_FAIL,
    LOGIN_REQUEST_SUCCESS,
} from "./actionTypes";

export const menuRequestLoad =  () => {
    return {
        type: LOGIN_REQUEST,
    };
}

export const menuReceiveLoad = (data) => {
    return {
        type: LOGIN_REQUEST_SUCCESS,
        // payload: data
    }
}
export const login = (form, redirectPath) => {
    return {
        types: ["FETCH_REQUEST","FETCH_REQUEST_SUCCESS","FETCH_REQUEST_FAIL"],
        promise: (apiClient) => apiClient.get(`Login/Login`, JSON.stringify(form))
    }
};
